import React from "react";

import "./css/PhotoGallery.css";

import Img0 from './img/blender/b_img (1).JPG';
import Img1 from './img/blender/b_img (2).JPG';
import Img2 from './img/blender/b_img (3).JPG';
import Img3 from './img/blender/b_img (4).JPG';
import Img4 from './img/blender/b_img (5).JPG';
import Img5 from './img/blender/b_img (8).JPG';
import Img6 from './img/blender/b_img (7).JPG';


class PhotoGallery extends React.Component {

  render() {
    return(
      <div className="container">
        <h2 className="heading-text">Photo <span>gallery</span></h2>
        <div className="image-gallery">
          <div className="column">
            <div className="image-item">
              <img src={Img0} alt="" />
              <div className="overlay"><span>Image title</span></div>
            </div>
            <div className="image-item">
              <img src={Img1} alt="" />
              <div className="overlay"><span>Image title</span></div>
            </div>
          </div>
          <div className="column">
            <div className="image-item">
              <img src={Img2} alt="" />
              <div className="overlay"><span>Image title</span></div>
            </div>
            <div className="image-item">
              <img src={Img3} alt="" />
              <div className="overlay"><span>Image title</span></div>
            </div>
          </div>
          <div className="column">
            <div className="image-item">
              <img src={Img4} alt="" />
              <div className="overlay"><span>Image title</span></div>
            </div>
            <div className="image-item">
              <img src={Img5} alt="" />        
              <div className="overlay"><span>Image title</span></div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default PhotoGallery;
